import React, { FC } from 'react';
import styles from './aside.module.scss';

interface AsideProps {}

const Aside: FC<AsideProps> = () => (
  <aside className={styles.Aside}>
    <nav>
      <a href="https://www.nike.com/il/w/mens-shoes-nik1zy7ok?sitelink=LLBrandX-CatE2&cp=57171225505_search_%7cnike%20shoes%7c10581748996%7c104847520975%7ce%7cc%7cIL%7cproducts%7c452044194902&ds_rl=1252249&gclid=Cj0KCQjwk7ugBhDIARIsAGuvgPYeR56c12V8kkhnOFTAB3FFg9RAssfkUrpK6XgQVrpBT_3O-RF1X9IaAiKSEALw_wcB&gclsrc=aw.ds">נעלי Nike</a>
      <a href="https://www.adidas.co.il/running?cm_mmc=AdieSEM_Google-_-Brand-_-Brand_English_Exact-_--_-dv:eCom-_-cn:PPC-Prospecting-brand-Multiple-Exact-IL-EMEA-eCom-Paid_Search-Brand-Exact-_-pc:Google&cm_mmc1=IL&cm_mmc2=PPC-Prospecting-brand-Multiple-Exact-IL-EMEA-eCom-Paid_Search-Brand-Exact&gclid=Cj0KCQjwk7ugBhDIARIsAGuvgPZH7ERgiJZNYl27RFkaUG1SyN30y_8FXUl7_Sqe-Xnmaf3eb8DOrboaAinxEALw_wcB">נעלי Adidas</a>
      <a href="https://www.walkin.co.il/16423-%D7%A0%D7%A2%D7%9C%D7%99-%D7%98%D7%99%D7%95%D7%9C%D7%99%D7%9D">נעליים לטיולים</a>
